import React from "react";
import "./SlickCard.css";

const SlickCard = ({ data }) => {
  return (
    <div className="slide-card-sup">
      <div className="slide-card-child-sup">
        <div className="">
          <h5>{item.title}</h5>
          <p>{item.todo}</p>
        </div>
        <div className="image">
          <img
            style={{ width: "100px" }}
            alt="calatop img"
            src="https://res.cloudinary.com/lmru-test/image/upload/f_auto,q_auto,dpr_1.0,d_photoiscoming.png/elbrus/images/main-new/offer/novyi-god-cat-new-main.jpg"
          />
        </div>
      </div>
    </div>
  );
};

export default SlickCard;
